[s]Description[/s][hr]A small description here about your dappervolk character.[/td][td][s]Abilities[/s][hr][b]Scatter[/b] butter cubes over flour and mix briefly with a fork or spatula to coat the butter with flour.

[b]Cut[/b] the butter into the flour with a pastry blender, working mixture until the flour has a coarse, mealy texture similar to fresh bread crumbs. About 1 – 2 minutes.

[b]Work[/b] butter and flour with the pastry blender until flour is evenly distributed. About 20 seconds. (Dough should look crumbly with pea-sized pieces).

[b]Sprinkle[/b] ice water over the mixture — start with 4 tablespoons and add from there. Using a rubber spatula, press the dough into itself. The crumbs should begin to form larger clusters. If you pinch some of the dough and it holds together, it’s ready. If the dough falls apart, add 2 to 4 more tablespoons of water and continue to press until dough comes together.[/td][/tr][/table][/left][url=https://dappervolk.com/forum/topic/748][img]https://i.imgur.com/rXV5fSn.png[/img][/url]


